@font-face {
  font-family: 'Source Sans Pro Black';
  src: url('../fonts/archivo-bold-webfont.woff2') format('woff2'), url('../fonts/archivo-bold-webfont.woff') format('woff');
  font-weight: 900;
  font-style: normal;
}

@font-face {
  font-family: 'Source Sans Pro Regular';
  src: url('../fonts/sourcesanspro-regular-webfont.woff2') format('woff2'), url('../fonts/sourcesanspro-regular-webfont.woff') format('woff');
  font-weight: 400;
  font-style: normal;
}

@font-face {
  font-family: 'Source Sans Pro Light';
  src: url('../fonts/sourcesanspro-light-webfont.woff2') format('woff2'), url('../fonts/sourcesanspro-light-webfont.woff') format('woff');
  font-weight: 300;
  font-style: normal;
}

.page-enter-active,
.page-leave-active {
  transition: opacity 0.25s ease-in-out;
}

.page-enter,
.page-leave-to {
  opacity: 0;
}

html {
  font-size: 62.5%;
}

h1 {
  font-family: 'Source Sans Pro Black', 'Arial', sans-serif;
  font-size: 2rem;
  padding: 0;
}

h2 {
  font-family: 'Source Sans Pro Black', 'Arial', sans-serif;
  font-size: 3.5rem;
  margin-top: 0;
  margin-bottom: 0.75rem;
}

h3 {
  font-family: 'Source Sans Pro Regular', 'Arial', sans-serif;
  font-size: 1.7rem;
  margin-top: 0;
  padding-bottom: 0.57em;
}

h4 {
  font-family: 'Source Sans Pro Light', 'Arial', sans-serif;
  font-size: 1.5rem;
  letter-spacing: 0.1em;
  line-height: 1.5em;
}

h5 {
  font-family: 'Source Sans Pro Black', 'Arial', sans-serif;
  font-size: 1.5em;
}

p {
  font-family: 'Source Sans Pro Light', 'Arial', sans-serif;
  font-size: 2rem;
  line-height: 3rem;
  margin-top: 0;
  margin-bottom: 0.8em;
}

nav ul {
  list-style-type: none;
}

nav {
  background-color: rgba(255, 255, 255, 1);
  -webkit-box-shadow: 0 35px 60px -27px rgba(0, 0, 0, 0.1);
  -moz-box-shadow: 0 35px 60px -27px rgba(0, 0, 0, 0.1);
  box-shadow: 0 35px 60px -27px rgba(0, 0, 0, 0.1);
}

input {
  width: 100%;
  border: none;
}

textarea {
  height: 120px;
  width: 100%;
  border: none;
}

a {
  color: black;
  text-decoration: none;
}

a:hover {
  color: black;
}

button {
  font-family: 'Source Sans Pro Black', sans-serif;
  background-color: #fff;
  background-color: rgba(255, 255, 255, 1);
  cursor: pointer;
  cursor: hand;
  transition: all 0.25s;
}

button:hover,
button:focus {
  background-color: #808080;
  background-color: rgba(0, 0, 0, 0.05);
  text-decoration: none;
  color: black;
  cursor: pointer;
  cursor: hand;
}

a.nav-link {
  color: #aaa;
}

li.nav-item a.nav-link {
  display: block;
  padding: 10px;
  height: 100%;
  width: 100%;
}

li.nav-item a.nav-link:hover {
  color: #aaa;
  transition: all 0.25s;
}

.nav-item {
  color: #aaa;
  background-color: rgba(0, 0, 0, 0);
  font-family: 'Source Sans Pro Light', sans-serif;
  font-size: 1.5rem;
  text-align: center;
  margin-left: 14px;
  margin-right: 14px;
  -webkit-box-shadow: -18px 6px 50px -10px rgba(0, 0, 0, 0.1);
  -moz-box-shadow: -18px 6px 50px -10px rgba(0, 0, 0, 0.1);
  box-shadow: -18px 6px 50px -10px rgba(0, 0, 0, 0.1);
  -o-transition: background-color 300ms ease;
  -moz-transition: background-color 300ms ease;
  -webkit-transition: background-color 300ms ease;
  -ms-transition: background-color 300ms ease;
  transition: background-color 300ms ease-in-out;
  transition: all 0.25s ease-in-out;
}

.nav-item:hover {
  background-color: #404040;
  background-color: rgba(0, 0, 0, 0.02);
  cursor: pointer;
  cursor: hand;
  transition: all 0.25s;
}

.btn {
  font-size: 3.5rem;
  text-align: center;
  white-space: nowrap;
  -webkit-user-select: none;
  -moz-user-select: none;
  -ms-user-select: none;
  user-select: none;
  border: 1px solid transparent;
  padding: 0 0.75rem;
  border-radius: 0.25rem;
  border-color: #ccc;
  border-color: rgba(204, 204, 204, 1);
}

.btn:first-child {
  margin-right: 12.5px;
}

.btn:nth-child(2) {
  margin-right: 12.5px;
}

.dialog-content {
  background-color: #fff;
  background-color: rgba(255, 255, 255, 1);
  padding: 40px;
}

.dialog-buttons {
  display: flex;
  flex: 0 1 auto;
  width: 100%;
  border-top: 1px solid #eee;
}

.dialog-buttons a {
  text-decoration: none;
  display: flex;
  flex: 0 1 auto;
  width: 100%;
  border-top: 1px solid #eee;
}

.dialog-buttons button {
  background-color: #fff;
  background-color: rgba(255, 255, 255, 1);
  padding: 0;
  margin: 0;
  border: 0;
  cursor: pointer;
  box-sizing: border-box;
  line-height: 44px;
  height: 44px;
}

.dialog-buttons button:hover {
  background-color: #eee;
  background-color: rgba(238, 238, 238, 1);
  cursor: pointer;
  cursor: hand;
  transition: all 0.25s;
}

.error-contact {
  color: #00bfff;
  color: hsl(195, 100%, 50%);
}

.error-contact:hover {
  color: black;
  cursor: pointer;
  cursor: hand;
  transition: all 0.25s;
}

.avatar {
  border-radius: 50%;
  overflow: hidden;
}

.designer {
  color: #f09;
  color: hsl(324, 100%, 50%);
}

.photographer {
  color: #f90;
  color: hsl(36, 100%, 50%);
}

.photojournalist {
  color: #00bfff;
  color: hsl(195, 100%, 50%);
}

.button-header {
  margin-top: 7px;
}

.input-button {
  font-family: 'Source Sans Pro Light', sans-serif;
  font-size: 0.8em;
  text-align: center;
}

.input-shadow {
  -webkit-box-shadow: inset -9px 0 66px -18px rgba(0, 0, 0, 0.1);
  -moz-box-shadow: inset -9px 0 66px -18px rgba(0, 0, 0, 0.1);
  box-shadow: inset -9px 0 66px -18px rgba(0, 0, 0, 0.1);
}

.active {
  background: #fafafa;
  background: rgba(250, 250, 250, 1);
  background: -moz-linear-gradient(left, rgba(250, 250, 250, 1) 0%, rgba(255, 255, 255, 0) 100%);
  background: -webkit-gradient(left top, right top, color-stop(0%, rgba(250, 250, 250, 1)), color-stop(100%, rgba(255, 255, 255, 0)));
  background: -webkit-linear-gradient(left, rgba(250, 250, 250, 1) 0%, rgba(255, 255, 255, 0) 100%);
  background: -o-linear-gradient(left, rgba(250, 250, 250, 1) 0%, rgba(255, 255, 255, 0) 100%);
  background: -ms-linear-gradient(left, rgba(250, 250, 250, 1) 0%, rgba(255, 255, 255, 0) 100%);
  background: linear-gradient(to right, rgba(250, 250, 250, 1) 0%, rgba(255, 255, 255, 0) 100%);
  filter: progid:dximagetransform.microsoft.gradient(startColorstr=  '#fafafa', endColorstr='#ffffff', GradientType=1);
}

.centered {
  margin: auto;
  max-width: 100%;
}

.school > li {
  margin-bottom: 1em;
}

.box-shadow {
  padding: 0 10px 10px;
  -webkit-box-shadow: -20px 0 50px -9px rgba(0, 0, 0, 0.04);
  -moz-box-shadow: -20px 0 50px -9px rgba(0, 0, 0, 0.04);
  box-shadow: -20px 0 50px -9px rgba(0, 0, 0, 0.04);
}

.box-shadow-bottom {
  padding: 10px;
  -webkit-box-shadow: 0 -20px 50px -9px rgba(0, 0, 0, 0.04);
  -moz-box-shadow: 0 -20px 50px -9px rgba(0, 0, 0, 0.04);
  box-shadow: 0 -20px 50px -9px rgba(0, 0, 0, 0.04);
}

.school {
  font-family: 'Source Sans Pro Light', sans-serif;
  font-size: 1.7rem;
  letter-spacing: 1.5px;
  list-style: none;
  padding: 0;
}

div a {
  display: block;
}

.img-fluid-one {
  width: 100%;
  height: auto;
}

.img-fluid-two {
  width: 47.5%;
  height: auto;
}

.img-fluid-three {
  width: 32%;
  height: auto;
}

.img-autoheight2 {
  max-height: 100%;
  width: auto;
}

.img-autoheight {
  width: 100%;
}

@media only screen and (max-width: 767px) {
  .img-autoheight {
    height: auto;
    width: 100vw;
    object-fit: cover;
  }
}

@media only screen and (min-width: 768px) and (max-width: 1200px) {
  .img-autoheight {
    height: auto;
    width: 100%;
    object-fit: cover;
  }
}

.hvrbox,
.hvrbox * {
  box-sizing: border-box;
}

.hvrbox {
  position: relative;
  display: inline-block;
  overflow: hidden;
  max-width: 100%;
  height: auto;
}

.hvrbox .hvrbox-layer_bottom {
  display: block;
}

.hvrbox img {
  filter: url("data:image/svg+xml;utf8,<svg xmlns=\'http://www.w3.org/2000/svg\'><filter id=\'grayscale\'><feColorMatrix type=\'matrix\' values=\'0.3333 0.3333 0.3333 0 0 0.3333 0.3333 0.3333 0 0 0.3333 0.3333 0.3333 0 0 0 0 0 1 0\'/></filter></svg>#grayscale");

  /* Firefox 3.5+ */
  filter: gray;

  /* IE6-9 */
  -webkit-filter: grayscale(100%);

  /* Chrome 19+ & Safari 6+ */
  transition: all 0.4s ease-in-out 0s;
}

.hvrbox:hover img {
  filter: none;
  -webkit-filter: grayscale(0%);
}

.hvrbox .hvrbox-layer_bottom {
  display: block;
}

.hvrbox .hvrbox-layer_top {
  opacity: 0;
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  width: 100%;
  height: 100%;
  color: #000;
  background: #ffff;
  background: rgba(255, 255, 255, 0.6);
  padding: 15px;
  -o-transition: all 0.4s ease-in-out 0s;
  -moz-transition: all 0.4s ease-in-out 0s;
  -webkit-transition: all 0.4s ease-in-out 0s;
  -ms-transition: all 0.4s ease-in-out 0s;
  transition: all 0.4s ease-in-out 0s;
}

.hvrbox.active .hvrbox-layer_top,
.hvrbox:hover .hvrbox-layer_top {
  opacity: 1;
}

.hvrbox .hvrbox-text {
  text-align: center;
  font-size: 18px;
  display: inline-block;
  position: absolute;
  top: 50%;
  left: 50%;
  -o-transform: translate(-50%, -50%);
  -moz-transform: translate(-50%, -50%);
  -webkit-transform: translate(-50%, -50%);
  -ms-transform: translate(-50%, -50%);
  transform: translate(-50%, -50%);
}

.hvrbox .hvrbox-text_mobile {
  font-size: 15px;
  border-top: 1px solid rgb(179, 179, 179);

  /* for old browsers */
  border-top: 1px solid rgba(179, 179, 179, 0.7);
  margin-top: 5px;
  padding-top: 2px;
  display: none;
}

.hvrbox.active .hvrbox-text_mobile {
  display: block;
}

.test-photography {
  padding-bottom: 5px;

  /* gradient can be an image */
  background: linear-gradient(to right, hsl(36, 100%, 50%) 0%, rgba(0, 0, 0, 0) 100%) left bottom #fff no-repeat;
  background-size: 100% 5px;

